import React from 'react'

export default function QuizView(props) {

    return (
        <div className="bg-special-black rounded-2xl">
            <div className="flex items-center justify-between">
                <div className="text-white ml-[15px]">{props.title}</div>
                <img className="w-[30px]" src={props.img}/>
            </div>
            
            <div className="text-white ml-[15px]">{props.description}</div>
        </div>
    )
}
